css:
.editor-colors {
  background-color: #002b36;
  color: #839496;
}
.editor .invisible-character {
  color: rgba(101, 123, 131, 0.19999999999999996);
}
.editor .indent-guide {
  color: rgba(101, 123, 131, 0.19999999999999996);
}
.editor .gutter {
  background-color: #073642;
  color: #839496;
}
.editor .gutter .line-number {
  opacity: 1;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #d33682;
}
.editor .cursor {
  border-color: #fdf6e3;
}
.editor .selection .region {
  background-color: #073a47;
}
.editor .line-number.cursor-line-no-selection {
  background-color: #0a4d5e;
}
.bracket-matcher {
  background-color: rgba(88, 110, 117, 0.8);
  opacity: 0.5;
}
.comment {
  color: #586e75;
  font-style: italic;
}
.entity {
  color: #b58900;
}
.entity .punctuation {
  color: #dc322f;
}
.keyword {
  color: #859900;
}
.keyword.other.special-method {
  color: #cb4b16;
}
.storage.type {
  color: #859900;
}
.constant {
  color: #b58900;
}
.constant.numeric,
.constant.boolean,
.constant.symbol,
.constant.symbol .punctuation {
  color: #2aa198;
}
.constant.symbol.hashkey {
  color: #dc322f;
}
.constant.symbol.hashkey .punctuation {
  color: #dc322f;
}
.delimiter,
.brace {
  color: #dc322f;
}
.delimiter.period {
  color: #859900;
}
.invalid.deprecated {
  text-decoration: underline;
  color: #dc322f;
}
.invalid.illegal {
  color: #dc322f;
}
.method .name {
  color: #268bd2;
}
.operator.assignment {
  color: #93a1a1;
}
.parameter {
  color: #93a1a1;
}
.property-name {
  color: #859900;
}
.property-value .unit {
  color: #839496;
}
.string {
  color: #2aa198;
}
.string .constant.character.escape {
  color: #dc322f;
}
.string .punctuation.string {
  color: #dc322f;
}
.string.regexp {
  color: #2aa198;
}
.string.regexp .source.ruby.embedded,
.string.regexp .string.regexp.arbitrary-repetition {
  color: #dc322f;
}
.variable {
  color: #2aa198;
}
.variable.instance {
  color: #268bd2;
}
.variable.constant {
  color: #b58900;
}
.editor .gfm .markup.italic {
  font-style: italic;
}
.editor .gfm .markup.bold {
  font-weight: bold;
}
.editor .gfm .markup.heading {
  color: #cb4b16;
}
.editor .gfm .link {
  color: #2aa198;
}
.editor .gfm .link .entity {
  color: #6c71c4;
}
.editor .gfm .raw {
  font-style: italic;
}
.editor .gfm.support {
  color: #dc322f;
}
